import React from "react";
import "./Navbar.css";

const NavbarList = [
  {
    type: "Stays",
    icon: "fas fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fas fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fas fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fas fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fas fa-taxi",
    active: true,
  },
];
function Navbar() {
  console.log(NavbarList[0].active);
  return (
    <div>
      <div className="navbar">
        <div className="booking-web">
          <span className="booking"> Booking Website</span>
          <button className="register">Register</button>
          <button className="login">Login</button>
        </div>
        <div className="nav-list">
          <div
            className="stay"
            style={
              NavbarList[0].active === true
                ? { border: "1px solid white", borderRadius: "12px " }
                : {}
            }
          >
            <i className={NavbarList[0].icon}></i>
            <span>{NavbarList[0].type}</span>
          </div>
          <div
            className="stay"
            style={
              NavbarList[1].active === true
                ? { border: "1px solid white", borderRadius: "12px " }
                : {}
            }
          >
            <i className={NavbarList[1].icon}></i>
            <span>{NavbarList[1].type}</span>
          </div>
          <div
            className="stay"
            style={
              NavbarList[2].active === true
                ? { border: "1px solid white", borderRadius: "12px " }
                : {}
            }
          >
            <i className={NavbarList[2].icon}></i>
            <span>{NavbarList[2].type}</span>
          </div>
          <div
            className="stay"
            style={
              NavbarList[3].active === true
                ? { border: "1px solid white", borderRadius: "12px " }
                : {}
            }
          >
            <i className={NavbarList[3].icon}></i>
            <span>{NavbarList[3].type}</span>
          </div>
          <div
            className="stay"
            style={
              NavbarList[4].active === true
                ? { border: "1px solid white", borderRadius: "12px " }
                : {}
            }
          >
            <i className={NavbarList[4].icon}></i>
            <span>{NavbarList[4].type}</span>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
